import classes from "./SearchPopup.module.css";
const SearchPopup = () => {
  return (
    <div className={classes.popup}>
      <h1>Search</h1>
      <form>
        <div>
          <p>Destination</p>
          <input className={classes.search}></input>
        </div>
        <div>
          <p>Check-in-Date</p>
          <input className={classes.search}></input>
        </div>
        <div className={classes.infor}>
          <p>Options</p>
          <div>
            <label>Min Price</label>
            <input></input>
          </div>
          <br></br>
          <div>
            <label>Max Price</label>
            <input></input>
          </div>
          <br></br>
          <div>
            <label>Aldult</label>
            <input></input>
          </div>
          <br></br>
          <div>
            <label>Children</label>
            <input></input>
          </div>
          <br></br>
          <div>
            <label>Room</label>
            <input></input>
          </div>
          <br></br>
          <button>Search</button>
        </div>
      </form>
    </div>
  );
};
export default SearchPopup;
